import React from "react";
import "./SidebarSwitch.css";

function SidebarSwitch(props) {
  var icon = props.icon,
      title = props.title,
      clickSidebarSwitch = props.clickSidebarSwitch;


  return React.createElement(
    "div",
    {
      role: "button",
      className: "sidebar-switch-wrap",
      onClick: clickSidebarSwitch
    },
    React.createElement(
      "span",
      { className: "sidebar-switch-icon" },
      icon
    ),
    React.createElement(
      "span",
      { className: "sidebar-switch-title" },
      title
    ),
    React.createElement(
      "span",
      { className: "sidebar-switch-button-wrap" },
      React.createElement("img", {
        className: "sidebar-switch-button",
        src: "../../public/sidebar-switch-button.png"
      })
    )
  );
}
export default SidebarSwitch;
